import React from 'react';

const Body = () => {
  return (
    <div className='pt-8'>
      <h1 className='text-5xl font-bold'>Lukas Arnroth</h1>
      <h1 className='text-l mt-1'>
        I am a PhD-candidate at the department of Statistics, Uppsala University
      </h1>
    </div>
  );
};

export default Body;
